import React, { Component } from "react";
import { BrowserRouter, Route } from "react-router-dom";

import Home from "./components/Home";

class Router extends Component {
    render() {
        return (
            <BrowserRouter>
                <Route path="/" component={Home} />
            </BrowserRouter>
        );
    }
}

export default Router;
